import React from 'react'

const se = {
    software: 'Software',
    engineer: 'Engineering'
}

const element = (
    <div>
            <h1>Jam</h1>
            <h2>I'm, {MyInfoFunc(se)}</h2>
            <p>Coding is love, have a great time</p>
            <ul>
                <li>HuaHin</li>
                <li>EU</li>
                <li>Japan</li>
            </ul>
        </div>
)

function MyInfoFunc() {
    return (
        se.software + " " + se.engineer
    )
}

export default MyInfoFunc
